import React from 'react';
import { Box, Container, Typography, Button, Grid, Card, CardContent } from '@mui/material';

const HomePage = () => {
  return (
    <Box sx={{ backgroundColor: '#f9f9f9', minHeight: '100vh', padding: '2rem 0' }}>
      <Container maxWidth="lg">
        {/* Header */}
        <Box textAlign="center" mb={4}>
          <Typography variant="h4" component="h1" gutterBottom>
            Seja uma Revendedora
          </Typography>
          <Typography variant="body1" color="textSecondary">
            Trabalhe com produtos de qualidade e conquiste sua independência financeira.
          </Typography>
          <Button variant="contained" color="primary" size="large" sx={{ mt: 2 }}>
            Cadastre-se Agora
          </Button>
        </Box>

        {/* Benefits Section */}
        <Grid container spacing={3}>
          {['Ganhe Mais', 'Produtos Exclusivos', 'Suporte Completo'].map((benefit, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Card sx={{ boxShadow: 3 }}>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    {benefit}
                  </Typography>
                  <Typography variant="body2" color="textSecondary">
                    {`Descrição sobre como ${benefit.toLowerCase()} pode ajudar você a alcançar seus objetivos.`}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* Footer */}
        <Box mt={5} textAlign="center">
          <Typography variant="body2" color="textSecondary">
            © {new Date().getFullYear()} Abelha Rainha. Todos os direitos reservados.
          </Typography>
        </Box>
      </Container>
    </Box>
  );
};

export default HomePage;
